var grpc = require('grpc');
var implementation = require('./clientimpl');
var protoLoader = require('@grpc/proto-loader');

const USER_PROTO_PATH = '../../proto/userhandler.proto';

var createPackageDef;
var userhandler;
var userClient;


function setup(){
	createPackageDef = (path) => protoLoader.loadSync(
	    path,
	    {keepCase: true,
	     longs: String,
	     enums: String,
	     defaults: true,
	     oneofs: true
	    });

	userhandler = grpc.loadPackageDefinition(createPackageDef(USER_PROTO_PATH)).userhandler;
	userClient = new userhandler.UserHandler('localhost:8081',grpc.credentials.createInsecure());
}

export const loginWithAccess = (token) =>{
	setup();
	implementation.login(userClient, token);	
}
